    include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12
    (CFC-12), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, Potential temperature (theta),
    SALINITY, SULFUR HEXAFLUORIDE (SF6) and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by J. Toole
    of Woods Hole Oceanographic Institution as part of the GLODAPv2_32OC20080510 data
